import React from 'react';
import {Link} from "react-router-dom";

const CustomLink = ({children, to}) => {
    return (
        <Link to={to} className={'text-white underline ml-auto py-2 px-3'}>
            {children}
        </Link>
    );
};

export default CustomLink;
